import { Button, IconButton, Typography } from "@mui/material";
import Card from "@mui/material/Card";
import Piechart from "./Piechart";
import { useState } from "react";
import { ExpenseModal, IncomeModal } from "./Modals";
import LocalDiningIcon from "@mui/icons-material/LocalDining";
import SportsEsportsIcon from "@mui/icons-material/SportsEsports";
import FlightIcon from "@mui/icons-material/Flight";
import HighlightOffIcon from '@mui/icons-material/HighlightOff';
import ModeIcon from '@mui/icons-material/Mode';

const Dashboard = () => {
    // Modals useStates
    const [openIncome, setOpenIncome] = useState(false);

    const handleOpenIncomeModal = () => {
        setOpenIncome(true);
    };

    const handleCloseIncomeModal = () => {
        setOpenIncome(false);
    };

    const [openExpense, setOpenExpense] = useState(false);

    const handleOpenExpenseModal = () => {
        setOpenExpense(true);
    };

    const handleCloseExpenseModal = () => {
        setOpenExpense(false);
    };
    // Modals useStates Ends here

    const [walletBalance, setWalletBalance] = useState(5000);

    const userData = {
        income: 5000,
        expenses: [
            {
                date: "2024-03-23",
                title: "Groceries",
                amount: 50,
                category: "Food",
            },
            {
                date: "2024-03-22",
                title: "Entertainment",
                amount: 30,
                category: "Entertainment",
            },
        ],
    };

    return (
        <div>
            <div
                className="top_section"
                style={{
                    backgroundColor: "#626262",
                    display: "flex",
                    justifyContent: "space-evenly",
                    alignItems: "center",
                    padding: "10px",
                    borderRadius: "15px",
                    height: "15rem",
                }}
            >
                <Card
                    className="income_card"
                    sx={{
                        width: "355.41px",
                        height: "181px",
                        backgroundColor: "#9b9b9b",
                        color: "#fff",
                        display: "flex",
                        justifyContent: "center",
                        flexDirection: "column",
                        alignItems: "center",
                    }}
                >
                    <Typography
                        sx={{
                            fontSize: "30px",
                            fontWeight: "400",
                            lineHeight: "34.47px",
                            paddingBottom: "20px",
                        }}
                    >
                        Wallet Balance:{" "}
                        <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
                            &#x20B9; {walletBalance}
                        </span>
                    </Typography>
                    <Button
                        sx={{
                            width: "80%",
                            color: "#fff",
                            backgroundColor: "rgba(181, 220, 82, 1)",
                            borderRadius: "15px",
                            ":hover": { backgroundColor: "rgba(181, 220, 82, 1)" },
                        }}
                        onClick={handleOpenIncomeModal}
                    >
                        + Add Income
                    </Button>
                </Card>

                <Card
                    className="expense_card"
                    sx={{
                        width: "355.41px",
                        height: "181px",
                        backgroundColor: "#9b9b9b",
                        color: "#fff",
                        display: "flex",
                        justifyContent: "center",
                        flexDirection: "column",
                        alignItems: "center",
                    }}
                >
                    <Typography
                        sx={{
                            fontSize: "30px",
                            fontWeight: "400",
                            lineHeight: "34.47px",
                            paddingBottom: "20px",
                        }}
                    >
                        Expense:{" "}
                        <span style={{ color: "rgba(157, 255, 91, 1)", fontWeight: "700" }}>
                            &#x20B9; 500
                        </span>
                    </Typography>
                    <Button
                        sx={{
                            width: "80%",
                            color: "#fff",
                            backgroundColor: "rgba(255, 149, 149, 1)",
                            borderRadius: "15px",
                            ":hover": { backgroundColor: "rgba(255, 149, 149, 1)" },
                        }}
                        onClick={handleOpenExpenseModal}
                    >
                        + Add Expense
                    </Button>
                </Card>
                <Piechart />
            </div>

            <IncomeModal
                open={openIncome}
                onClose={handleCloseIncomeModal}
                setWalletBalance={setWalletBalance}
            />
            <ExpenseModal
                open={openExpense}
                onClose={handleCloseExpenseModal}
                walletBalance={walletBalance}
                setWalletBalance={setWalletBalance}
            />
            <div>
                <div>
                    <h3>Recent transactions</h3>
                    <Card>
                        {userData.expenses.map((e) => (
                            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "flex-start", width: "100%", margin: 0 }}>
                                <div style={{ display: "flex", justifyContent: "start" }}>
                                    <LocalDiningIcon />
                                    <div style={{ display: "flex", justifyContent: "center", flexDirection: "column", }} >
                                        <Typography>{e.title}</Typography>
                                        <Typography>{e.date}</Typography>
                                    </div>
                                </div>
                                <div style={{ display: "flex", flexDirection: "row", alignItems: "center" }}>
                                    <div style={{ color: "rgba(244, 187, 74, 1)", fontSize: "16px", fontWeight: "700" }}>&#x20B9;{e.amount}</div>
                                    <div style={{ display: "flex", alignItems: "center" }}>
                                        <IconButton sx={{backgroundColor:"rgba(255, 62, 62, 1)"}}><HighlightOffIcon /></IconButton>
                                        <IconButton sx={{backgroundColor:"rgba(244, 187, 74, 1)"}}><ModeIcon /></IconButton>
                                    </div>
                                </div>
                            </div>
                        ))}
                    </Card>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
